import PrintingOneStar from './PrintingOneStar'

class Rating extends Component {

    render() {
        let rating = this.props.rating
        let icons = '';
        for(let i = 0; i < 5; i++ ){
            if(rating - 1 >= 0){
                //print full star
                rating-=1;
                //return <FontAwesomeIcon icon={solidStar} />
                <PrintingOneStar num={1}/>
            }
            else{
                if(rating - 0.5 >= 0){
                    //print half star
                    rating-=0.5;
                    //return <FontAwesomeIcon icon={halfStar} />
                    <PrintingOneStar num={0.5}/>
                }
                else{
                    //print empty star
                    //return <FontAwesomeIcon icon={emptyStar} />
                    <PrintingOneStar num={0}/>
                }
            }
        }
